-- Name: get_highest_content_version(bigint); Type: FUNCTION; Schema: campus; Owner: fhcomplete
--

CREATE FUNCTION campus.get_highest_content_version(bigint) RETURNS smallint
    LANGUAGE plpgsql
    AS $_$
					DECLARE i_content_id ALIAS FOR $1;
					DECLARE rec RECORD;
					BEGIN
					SELECT INTO rec version
					FROM campus.tbl_contentsprache
					WHERE content_id=i_content_id
					ORDER BY version desc
					LIMIT 1;

			RETURN rec.version;
			END;
			$_$;


ALTER FUNCTION campus.get_highest_content_version(bigint) OWNER TO fhcomplete;

--
-- Name: get_rolle_prestudent(integer, character varying); Type: FUNCTION; Schema: public; Owner: fhcomplete
--

CREATE FUNCTION public.get_rolle_prestudent(integer, character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $_$
                        DECLARE i_prestudent_id ALIAS FOR $1;
                        DECLARE cv_studiensemester_kurzbz ALIAS FOR $2;
                        DECLARE rec RECORD;
                        BEGIN
                            IF (cv_studiensemester_kurzbz IS NULL) THEN
                                SELECT INTO rec status_kurzbz 
                                FROM public.tbl_prestudentstatus
                                WHERE prestudent_id=i_prestudent_id 
                                ORDER BY datum desc,insertamum desc, ext_id desc
                                LIMIT 1;
                            ELSE
                                SELECT INTO rec status_kurzbz 
                                FROM tbl_prestudentstatus 
                                WHERE prestudent_id=i_prestudent_id AND studiensemester_kurzbz=cv_studiensemester_kurzbz
                                ORDER BY datum desc,insertamum desc, ext_id desc
                                LIMIT 1;
                            END IF;

                        RETURN rec.status_kurzbz;
                        END;
                        $_$;


ALTER FUNCTION public.get_rolle_prestudent(integer, character varying) OWNER TO fhcomplete;

--
-- Name: transform_geschlecht(character, date); Type: FUNCTION; Schema: public; Owner: fhcomplete
--

CREATE FUNCTION public.transform_geschlecht(character, date) RETURNS character
    LANGUAGE plpgsql
    AS $_$
			DECLARE geschlecht ALIAS FOR $1;
			DECLARE gebdatum ALIAS FOR $2;

			BEGIN
				IF geschlecht='x' THEN
					IF date_part('day', gebdatum)::int%2=0 THEN
						geschlecht:='m';
					ELSE
						geschlecht:='w';
					END IF;
				END IF;
			RETURN geschlecht;
			END;
		$_$;


