-- Name: vw_benutzer; Type: VIEW; Schema: campus; Owner: fhcomplete
--

CREATE VIEW campus.vw_benutzer AS
 SELECT tbl_benutzer.person_id,
    tbl_benutzer.uid,
    tbl_benutzer.alias,
    tbl_person.geburtsnation,
    tbl_person.sprache,
    tbl_person.anrede,
    tbl_person.titelpost,
    tbl_person.titelpre,
    tbl_person.nachname,
    tbl_person.vorname,
    tbl_person.vornamen,
    tbl_person.gebdatum,
    tbl_person.gebort,
    tbl_person.gebzeit,
    tbl_person.foto,
    tbl_person.geschlecht,
    tbl_person.anmerkung,
    tbl_person.homepage,
    tbl_person.svnr,
    tbl_person.ersatzkennzeichen,
    tbl_person.familienstand,
    tbl_person.anzahlkinder,
    tbl_benutzer.aktiv,
    tbl_benutzer.insertamum,
    tbl_benutzer.insertvon,
    tbl_benutzer.updateamum,
    tbl_benutzer.updatevon,
    tbl_benutzer.ext_id
   FROM (public.tbl_benutzer
     JOIN public.tbl_person USING (person_id));


