CREATE VIEW campus.vw_persongruppe AS
 SELECT tbl_benutzer.uid,
    tbl_benutzergruppe.gruppe_kurzbz,
    tbl_gruppe.studiengang_kz,
    tbl_person.nachname,
    tbl_person.vorname,
    tbl_person.vornamen,
