    tbl_person.titelpost,
    tbl_person.titelpre,
    tbl_person.staatsbuergerschaft,
    tbl_person.geburtsnation,
    tbl_person.sprache,
    tbl_person.anrede,
    tbl_person.gebort,
    tbl_person.gebzeit,
    tbl_person.foto,
    tbl_person.homepage,
    tbl_person.svnr,
    tbl_person.ersatzkennzeichen,
    tbl_person.familienstand,
    tbl_person.geschlecht,
    tbl_person.anzahlkinder,
    tbl_benutzer.alias,
    tbl_person.anmerkung,
    tbl_person.aktiv AS aktivperson,
    tbl_gruppe.mailgrp,
    tbl_gruppe.sichtbar,
    tbl_benutzer.aktiv AS aktivbenutzer,
    tbl_gruppe.semester,
    tbl_gruppe.bezeichnung,
    tbl_gruppe.beschreibung,
    tbl_gruppe.generiert,
    tbl_gruppe.aktiv AS aktivgruppe,
