--
-- Name: vw_stundenplan; Type: VIEW; Schema: campus; Owner: fhcomplete
--

CREATE VIEW campus.vw_stundenplan AS
 SELECT tbl_stundenplan.stundenplan_id,
    tbl_stundenplan.unr,
    tbl_stundenplan.mitarbeiter_uid AS uid,
    tbl_stundenplan.lehreinheit_id,
    tbl_lehreinheit.lehrfach_id,
    tbl_stundenplan.datum,
    tbl_stundenplan.stunde,
    tbl_stundenplan.ort_kurzbz,
    tbl_stundenplan.studiengang_kz,
    tbl_stundenplan.semester,
    tbl_stundenplan.verband,
    tbl_stundenplan.gruppe,
    tbl_stundenplan.gruppe_kurzbz,
    tbl_stundenplan.titel,
    tbl_stundenplan.anmerkung,
    tbl_stundenplan.fix,
    tbl_lehreinheit.lehrveranstaltung_id,
    tbl_studiengang.kurzbz AS stg_kurzbz,
    tbl_studiengang.kurzbzlang AS stg_kurzbzlang,
    tbl_studiengang.bezeichnung AS stg_bezeichnung,
    tbl_studiengang.typ AS stg_typ,
    ( SELECT tbl_fachbereich.fachbereich_kurzbz
           FROM public.tbl_fachbereich
          WHERE ((tbl_fachbereich.oe_kurzbz)::text = (lehrfach.oe_kurzbz)::text)) AS fachbereich_kurzbz,
    lehrfach.kurzbz AS lehrfach,
    lehrfach.bezeichnung AS lehrfach_bez,
    lehrfach.farbe,
    tbl_lehreinheit.lehrform_kurzbz AS lehrform,
    tbl_mitarbeiter.kurzbz AS lektor,
    tbl_stundenplan.updateamum,
    tbl_stundenplan.updatevon,
    tbl_stundenplan.insertamum,
    tbl_stundenplan.insertvon
   FROM ((((lehre.tbl_stundenplan
     JOIN public.tbl_studiengang USING (studiengang_kz))
     JOIN lehre.tbl_lehreinheit USING (lehreinheit_id))
     JOIN lehre.tbl_lehrveranstaltung lehrfach ON ((tbl_lehreinheit.lehrfach_id = lehrfach.lehrveranstaltung_id)))
     JOIN public.tbl_mitarbeiter USING (mitarbeiter_uid));


