--
-- Name: vw_betriebsmittelperson; Type: VIEW; Schema: public; Owner: fhcomplete
--

CREATE VIEW public.vw_betriebsmittelperson AS
 SELECT tbl_betriebsmittelperson.betriebsmittelperson_id,
    tbl_betriebsmittelperson.betriebsmittel_id,
    tbl_betriebsmittelperson.person_id,
    tbl_betriebsmittelperson.anmerkung,
    tbl_betriebsmittelperson.kaution,
    tbl_betriebsmittelperson.ausgegebenam,
    tbl_betriebsmittelperson.retouram,
    tbl_betriebsmittelperson.insertamum,
    tbl_betriebsmittelperson.insertvon,
    tbl_betriebsmittelperson.updateamum,
    tbl_betriebsmittelperson.updatevon,
    tbl_betriebsmittelperson.ext_id,
    tbl_betriebsmittel.beschreibung,
    tbl_betriebsmittel.betriebsmitteltyp,
    tbl_betriebsmittel.nummer,
    tbl_betriebsmittel.inventarnummer AS nummerintern,
    tbl_betriebsmittel.reservieren,
    tbl_betriebsmittel.ort_kurzbz,
    tbl_person.staatsbuergerschaft,
    tbl_person.geburtsnation,
    tbl_person.sprache,
    tbl_person.anrede,
    tbl_person.titelpost,
    tbl_person.titelpre,
    tbl_person.nachname,
    tbl_person.vorname,
    tbl_person.vornamen,
    tbl_person.gebdatum,
    tbl_person.gebort,
    tbl_person.gebzeit,
    tbl_person.foto,
    tbl_person.anmerkung AS anmerkungen,
    tbl_person.homepage,
    tbl_person.svnr,
    tbl_person.ersatzkennzeichen,
    tbl_person.familienstand,
    tbl_person.geschlecht,
    tbl_person.anzahlkinder,
    tbl_person.aktiv,
    tbl_benutzer.uid,
    tbl_benutzer.aktiv AS benutzer_aktiv,
    tbl_benutzer.alias
   FROM (((wawi.tbl_betriebsmittelperson
     JOIN wawi.tbl_betriebsmittel USING (betriebsmittel_id))
     JOIN public.tbl_person USING (person_id))
     LEFT JOIN public.tbl_benutzer USING (person_id));


ALTER TABLE public.vw_betriebsmittelperson OWNER TO fhcomplete;

--
-- Name: vw_gruppen; Type: VIEW; Schema: public; Owner: fhcomplete
--

CREATE VIEW public.vw_gruppen AS
 SELECT tbl_gruppe.gid,
    tbl_gruppe.gruppe_kurzbz,
    tbl_benutzergruppe.uid,
    tbl_gruppe.mailgrp,
    tbl_gruppe.beschreibung,
    tbl_gruppe.studiengang_kz,
    tbl_gruppe.semester,
    tbl_benutzergruppe.studiensemester_kurzbz,
    NULL::bpchar AS verband,
    NULL::bpchar AS gruppe
   FROM (public.tbl_gruppe
     LEFT JOIN public.tbl_benutzergruppe USING (gruppe_kurzbz))
UNION
 SELECT tbl_lehrverband.gid,
    upper(btrim((((( SELECT ((tbl_studiengang.typ)::text || (tbl_studiengang.kurzbz)::text)
           FROM public.tbl_studiengang
          WHERE (tbl_studiengang.studiengang_kz = tbl_lehrverband.studiengang_kz)) || tbl_lehrverband.semester) || (tbl_lehrverband.verband)::text) || (tbl_lehrverband.gruppe)::text))) AS gruppe_kurzbz,
    tbl_studentlehrverband.student_uid AS uid,
    true AS mailgrp,
    tbl_lehrverband.bezeichnung AS beschreibung,
    tbl_lehrverband.studiengang_kz,
    tbl_lehrverband.semester,
    tbl_studentlehrverband.studiensemester_kurzbz,
    tbl_lehrverband.verband,
    tbl_lehrverband.gruppe
   FROM (public.tbl_lehrverband
     LEFT JOIN public.tbl_studentlehrverband USING (studiengang_kz, semester))
  WHERE (((tbl_lehrverband.verband = tbl_studentlehrverband.verband) OR (tbl_lehrverband.verband IS NULL) OR (btrim((tbl_lehrverband.verband)::text) = ''::text) OR (tbl_studentlehrverband.verband IS NULL)) AND ((tbl_lehrverband.gruppe = tbl_studentlehrverband.gruppe) OR (tbl_lehrverband.gruppe IS NULL) OR (btrim((tbl_lehrverband.gruppe)::text) = ''::text) OR (tbl_studentlehrverband.gruppe IS NULL)));


ALTER TABLE public.vw_gruppen OWNER TO fhcomplete;

--
-- Name: vw_msg_vars; Type: VIEW; Schema: public; Owner: fhcomplete
--

CREATE VIEW public.vw_msg_vars AS
 SELECT DISTINCT ON (p.person_id, pr.prestudent_id) p.person_id,
    pr.prestudent_id,
    p.nachname AS "Nachname",
    p.vorname AS "Vorname",
    p.anrede AS "Anrede",
    a.strasse AS "Strasse",
    a.ort AS "Ort",
    a.plz AS "PLZ",
    a.gemeinde AS "Gemeinde",
    a.langtext AS "Nation",
    ke.kontakt AS "Email",
    kt.kontakt AS "Telefon",
    s.bezeichnung AS "Studiengang DE",
    s.english AS "Studiengang EN",
    st.bezeichnung AS "Typ",
    last_prestudent_status.orgform_kurzbz AS "Orgform",
    p.zugangscode AS "Zugangscode",
    bk.iban AS "IBAN Studiengang",
    bk.bic AS "BIC Studiengang",
    s.studiengang_kz AS "Studiengangskennzahl",
    first_prestudent_status.ausbildungssemester AS "Einstiegssemester",
    first_prestudent_status.studiensemester AS "Einstiegsstudiensemester",
    ass.vorname AS "Vorname Studiengangsassistenz",
    ass.nachname AS "Nachname Studiengangsassistenz",
    ass.telefonklappe AS "Durchwahl Studiengangsassistenz",
    ass.alias AS "Alias Studiengangsassistenz",
    ( SELECT count(*) AS count
           FROM ( SELECT pss.prestudent_id,
                    pss.person_id,
                    pss.priorisierung,
                    ( SELECT tbl_prestudentstatus_1.status_kurzbz
                           FROM public.tbl_prestudentstatus tbl_prestudentstatus_1
                          WHERE (tbl_prestudentstatus_1.prestudent_id = pss.prestudent_id)
                          ORDER BY tbl_prestudentstatus_1.datum DESC, tbl_prestudentstatus_1.insertamum DESC
                         LIMIT 1) AS laststatus
                   FROM (public.tbl_prestudent pss
                     JOIN public.tbl_prestudentstatus USING (prestudent_id))
                  WHERE ((pss.person_id = ( SELECT tbl_prestudent.person_id
                           FROM public.tbl_prestudent
                          WHERE (tbl_prestudent.prestudent_id = pr.prestudent_id))) AND ((tbl_prestudentstatus.studiensemester_kurzbz)::text = (( SELECT tbl_prestudentstatus_1.studiensemester_kurzbz
                           FROM public.tbl_prestudentstatus tbl_prestudentstatus_1
                          WHERE ((tbl_prestudentstatus_1.prestudent_id = pr.prestudent_id) AND ((tbl_prestudentstatus_1.status_kurzbz)::text = 'Interessent'::text))
                         LIMIT 1))::text) AND ((tbl_prestudentstatus.status_kurzbz)::text = 'Interessent'::text))) prest
          WHERE (((prest.laststatus)::text <> ALL ((ARRAY['Abbrecher'::character varying, 'Abgewiesener'::character varying, 'Absolvent'::character varying])::text[])) AND (prest.priorisierung <= pr.priorisierung))) AS "Relative Prio",
    last_prestudent_status.orgform_bezeichnung_de AS "Orgform DE",
    last_prestudent_status.orgform_bezeichnung_en AS "Orgform EN"
   FROM ((((((((((public.tbl_person p
     LEFT JOIN ( SELECT tbl_kontakt.person_id,
            tbl_kontakt.kontakt
           FROM public.tbl_kontakt
          WHERE ((tbl_kontakt.zustellung = true) AND ((tbl_kontakt.kontakttyp)::text = 'email'::text))
          ORDER BY tbl_kontakt.kontakt_id DESC) ke USING (person_id))
     LEFT JOIN ( SELECT tbl_kontakt.person_id,
            tbl_kontakt.kontakt
           FROM public.tbl_kontakt
          WHERE ((tbl_kontakt.zustellung = true) AND ((tbl_kontakt.kontakttyp)::text = ANY ((ARRAY['telefon'::character varying, 'mobil'::character varying])::text[])))
          ORDER BY tbl_kontakt.kontakt_id DESC) kt USING (person_id))
     LEFT JOIN ( SELECT tbl_adresse.person_id,
            tbl_adresse.strasse,
            tbl_adresse.ort,
            tbl_adresse.plz,
            tbl_adresse.gemeinde,
            tbl_nation.langtext
           FROM (public.tbl_adresse
             LEFT JOIN bis.tbl_nation ON (((tbl_nation.nation_code)::text = (tbl_adresse.nation)::text)))
          WHERE (tbl_adresse.heimatadresse = true)
          ORDER BY tbl_adresse.adresse_id DESC) a USING (person_id))
     LEFT JOIN public.tbl_prestudent pr USING (person_id))
     JOIN public.tbl_studiengang s USING (studiengang_kz))
     JOIN public.tbl_studiengangstyp st USING (typ))
     LEFT JOIN ( SELECT DISTINCT ON (ps.prestudent_id) ps.prestudent_id,
            tbl_studienplan.orgform_kurzbz,
            tbl_orgform.bezeichnung_mehrsprachig[( SELECT tbl_sprache.index
                   FROM public.tbl_sprache
                  WHERE ((tbl_sprache.content = true) AND ((tbl_sprache.sprache)::text = 'German'::text))
                 LIMIT 1)] AS orgform_bezeichnung_de,
            tbl_orgform.bezeichnung_mehrsprachig[( SELECT tbl_sprache.index
                   FROM public.tbl_sprache
                  WHERE ((tbl_sprache.content = true) AND ((tbl_sprache.sprache)::text = 'English'::text))
                 LIMIT 1)] AS orgform_bezeichnung_en
           FROM (((public.tbl_prestudent ps
             JOIN public.tbl_prestudentstatus ON ((ps.prestudent_id = tbl_prestudentstatus.prestudent_id)))
             JOIN lehre.tbl_studienplan USING (studienplan_id))
             LEFT JOIN bis.tbl_orgform ON (((tbl_studienplan.orgform_kurzbz)::text = (tbl_orgform.orgform_kurzbz)::text)))
          ORDER BY ps.prestudent_id DESC, tbl_prestudentstatus.datum DESC, tbl_prestudentstatus.insertamum DESC, tbl_prestudentstatus.ext_id DESC) last_prestudent_status ON ((pr.prestudent_id = last_prestudent_status.prestudent_id)))
     LEFT JOIN ( SELECT DISTINCT ON (ps.prestudent_id) ps.prestudent_id,
            tbl_prestudentstatus.ausbildungssemester,
            tbl_prestudentstatus.studiensemester_kurzbz,
            tbl_studiensemester.bezeichnung AS studiensemester,
            tbl_studienordnung.studiengang_kz
           FROM ((((public.tbl_prestudent ps
             JOIN public.tbl_prestudentstatus ON ((ps.prestudent_id = tbl_prestudentstatus.prestudent_id)))
             JOIN public.tbl_studiensemester USING (studiensemester_kurzbz))
             JOIN lehre.tbl_studienplan USING (studienplan_id))
             JOIN lehre.tbl_studienordnung USING (studienordnung_id))
          WHERE ((tbl_prestudentstatus.status_kurzbz)::text = 'Interessent'::text)
          ORDER BY ps.prestudent_id, tbl_prestudentstatus.datum, tbl_prestudentstatus.insertamum, tbl_prestudentstatus.ext_id) first_prestudent_status ON ((pr.prestudent_id = first_prestudent_status.prestudent_id)))
     LEFT JOIN ( SELECT DISTINCT ON (tbl_benutzerfunktion.oe_kurzbz) tbl_person.vorname,
            tbl_person.nachname,
            tbl_benutzerfunktion.oe_kurzbz,
            tbl_mitarbeiter.telefonklappe,
            tbl_benutzer.alias
           FROM (((public.tbl_benutzerfunktion
             JOIN public.tbl_benutzer USING (uid))
             JOIN public.tbl_person USING (person_id))
             JOIN public.tbl_mitarbeiter ON (((tbl_benutzer.uid)::text = (tbl_mitarbeiter.mitarbeiter_uid)::text)))
          WHERE (((tbl_benutzerfunktion.funktion_kurzbz)::text = 'ass'::text) AND ((now() >= COALESCE((tbl_benutzerfunktion.datum_von)::timestamp with time zone, now())) AND (now() <= COALESCE((tbl_benutzerfunktion.datum_bis)::timestamp with time zone, now()))))
          ORDER BY tbl_benutzerfunktion.oe_kurzbz, tbl_benutzerfunktion.insertamum DESC NULLS LAST, tbl_benutzerfunktion.datum_von DESC NULLS LAST) ass ON (((s.oe_kurzbz)::text = (ass.oe_kurzbz)::text)))
     LEFT JOIN ( SELECT DISTINCT ON (tbl_bankverbindung.oe_kurzbz, tbl_bankverbindung.orgform_kurzbz) tbl_bankverbindung.oe_kurzbz,
            tbl_bankverbindung.orgform_kurzbz,
            tbl_bankverbindung.iban,
            tbl_bankverbindung.bic
           FROM public.tbl_bankverbindung
          WHERE (tbl_bankverbindung.oe_kurzbz IS NOT NULL)
          ORDER BY tbl_bankverbindung.oe_kurzbz, tbl_bankverbindung.orgform_kurzbz, tbl_bankverbindung.insertamum DESC, tbl_bankverbindung.iban) bk ON ((((s.oe_kurzbz)::text = (bk.oe_kurzbz)::text) AND (((last_prestudent_status.orgform_kurzbz)::text = (bk.orgform_kurzbz)::text) OR (bk.orgform_kurzbz IS NULL)))))
  WHERE (p.aktiv = true)
  ORDER BY p.person_id, pr.prestudent_id;


ALTER TABLE public.vw_msg_vars OWNER TO fhcomplete;

--
-- Name: vw_msg_vars_person; Type: VIEW; Schema: public; Owner: fhcomplete
--

CREATE VIEW public.vw_msg_vars_person AS
 SELECT DISTINCT ON (p.person_id) p.person_id,
    p.nachname AS "Nachname",
    p.vorname AS "Vorname",
    p.anrede AS "Anrede",
    a.strasse AS "Strasse",
    a.ort AS "Ort",
    a.plz AS "PLZ",
    a.gemeinde AS "Gemeinde",
    a.langtext AS "Nation",
    ke.kontakt AS "Email",
    kt.kontakt AS "Telefon",
    ( SELECT tbl_studiensemester.bezeichnung
           FROM public.tbl_studiensemester
          WHERE (("substring"((tbl_studiensemester.studiensemester_kurzbz)::text, 1, 2) = 'WS'::text) AND (((tbl_studiensemester.start >= now()) AND (tbl_studiensemester.ende >= now())) OR ((tbl_studiensemester.start <= now()) AND (tbl_studiensemester.ende >= now()))))
          ORDER BY tbl_studiensemester.start
         LIMIT 1) AS "WS naechstes",
    ( SELECT tbl_studiensemester.bezeichnung
           FROM public.tbl_studiensemester
          WHERE (("substring"((tbl_studiensemester.studiensemester_kurzbz)::text, 1, 2) = 'WS'::text) AND (((tbl_studiensemester.start >= now()) AND (tbl_studiensemester.ende >= now())) OR ((tbl_studiensemester.start <= now()) AND (tbl_studiensemester.ende >= now()))))
          ORDER BY tbl_studiensemester.start
         OFFSET 1
         LIMIT 1) AS "WS uebernaechstes",
    p.zugangscode AS "Zugangscode"
   FROM (((public.tbl_person p
     LEFT JOIN ( SELECT tbl_kontakt.person_id,
            tbl_kontakt.kontakt
           FROM public.tbl_kontakt
          WHERE ((tbl_kontakt.zustellung = true) AND ((tbl_kontakt.kontakttyp)::text = 'email'::text))
          ORDER BY tbl_kontakt.kontakt_id DESC) ke USING (person_id))
     LEFT JOIN ( SELECT tbl_kontakt.person_id,
            tbl_kontakt.kontakt
           FROM public.tbl_kontakt
          WHERE ((tbl_kontakt.zustellung = true) AND ((tbl_kontakt.kontakttyp)::text = ANY ((ARRAY['telefon'::character varying, 'mobil'::character varying])::text[])))
          ORDER BY tbl_kontakt.kontakt_id DESC) kt USING (person_id))
     LEFT JOIN ( SELECT tbl_adresse.person_id,
            tbl_adresse.strasse,
            tbl_adresse.ort,
            tbl_adresse.plz,
            tbl_adresse.gemeinde,
            tbl_nation.langtext
           FROM (public.tbl_adresse
             LEFT JOIN bis.tbl_nation ON (((tbl_nation.nation_code)::text = (tbl_adresse.nation)::text)))
          WHERE (tbl_adresse.heimatadresse = true)
          ORDER BY tbl_adresse.adresse_id DESC) a USING (person_id))
  ORDER BY p.person_id;


ALTER TABLE public.vw_msg_vars_person OWNER TO fhcomplete;

--
-- Name: vw_msg_vars_user; Type: VIEW; Schema: public; Owner: fhcomplete
