--
-- Name: vw_berechtigung_nichtrekursiv; Type: VIEW; Schema: system; Owner: fhcomplete
--

CREATE VIEW system.vw_berechtigung_nichtrekursiv AS
 SELECT a.uid,
    a.berechtigung_kurzbz,
        CASE
            WHEN (length((a.art)::text) > length((a.art1)::text)) THEN a.art1
            ELSE a.art
        END AS art,
    a.oe_kurzbz,
    a.kostenstelle_id
   FROM (( SELECT tbl_benutzerrolle.benutzerberechtigung_id,
            tbl_benutzerrolle.uid,
            tbl_benutzerrolle.funktion_kurzbz,
            tbl_benutzerrolle.rolle_kurzbz,
            tbl_benutzerrolle.berechtigung_kurzbz,
            tbl_benutzerrolle.art,
            tbl_benutzerrolle.art AS art1,
            tbl_benutzerrolle.oe_kurzbz,
            tbl_benutzerrolle.studiensemester_kurzbz,
            tbl_benutzerrolle.start,
            tbl_benutzerrolle.ende,
            tbl_benutzerrolle.negativ,
            tbl_benutzerrolle.updateamum,
            tbl_benutzerrolle.updatevon,
            tbl_benutzerrolle.insertamum,
            tbl_benutzerrolle.insertvon,
            tbl_benutzerrolle.kostenstelle_id,
            tbl_benutzerrolle.anmerkung
           FROM (system.tbl_benutzerrolle
             JOIN system.tbl_berechtigung USING (berechtigung_kurzbz))
        UNION
         SELECT tbl_benutzerrolle.benutzerberechtigung_id,
            tbl_benutzerrolle.uid,
            tbl_benutzerrolle.funktion_kurzbz,
            tbl_benutzerrolle.rolle_kurzbz,
            tbl_berechtigung.berechtigung_kurzbz,
            tbl_benutzerrolle.art,
            tbl_rolleberechtigung.art AS art1,
            tbl_benutzerrolle.oe_kurzbz,
            tbl_benutzerrolle.studiensemester_kurzbz,
            tbl_benutzerrolle.start,
            tbl_benutzerrolle.ende,
            tbl_benutzerrolle.negativ,
            tbl_benutzerrolle.updateamum,
            tbl_benutzerrolle.updatevon,
            tbl_benutzerrolle.insertamum,
            tbl_benutzerrolle.insertvon,
            tbl_benutzerrolle.kostenstelle_id,
            tbl_benutzerrolle.anmerkung
           FROM (((system.tbl_benutzerrolle
             JOIN system.tbl_rolle USING (rolle_kurzbz))
             JOIN system.tbl_rolleberechtigung USING (rolle_kurzbz))
             JOIN system.tbl_berechtigung ON (((tbl_rolleberechtigung.berechtigung_kurzbz)::text = (tbl_berechtigung.berechtigung_kurzbz)::text)))
        UNION
         SELECT tbl_benutzerrolle.benutzerberechtigung_id,
            tbl_benutzerfunktion.uid,
            tbl_benutzerrolle.funktion_kurzbz,
            tbl_benutzerrolle.rolle_kurzbz,
            tbl_benutzerrolle.berechtigung_kurzbz,
            tbl_benutzerrolle.art,
            tbl_benutzerrolle.art AS art1,
            tbl_benutzerfunktion.oe_kurzbz,
            tbl_benutzerrolle.studiensemester_kurzbz,
            tbl_benutzerrolle.start,
            tbl_benutzerrolle.ende,
            tbl_benutzerrolle.negativ,
            tbl_benutzerrolle.updateamum,
            tbl_benutzerrolle.updatevon,
            tbl_benutzerrolle.insertamum,
            tbl_benutzerrolle.insertvon,
            tbl_benutzerrolle.kostenstelle_id,
            tbl_benutzerrolle.anmerkung
           FROM (system.tbl_benutzerrolle
             JOIN public.tbl_benutzerfunktion USING (funktion_kurzbz))
          WHERE (((tbl_benutzerfunktion.datum_von IS NULL) OR (tbl_benutzerfunktion.datum_von <= now())) AND ((tbl_benutzerfunktion.datum_bis IS NULL) OR (tbl_benutzerfunktion.datum_bis >= now())))
        UNION
         SELECT tbl_benutzerrolle.benutzerberechtigung_id,
            vw_mitarbeiter.uid,
            tbl_benutzerrolle.funktion_kurzbz,
            tbl_benutzerrolle.rolle_kurzbz,
            tbl_benutzerrolle.berechtigung_kurzbz,
            tbl_benutzerrolle.art,
            tbl_benutzerrolle.art AS art1,
            tbl_benutzerrolle.oe_kurzbz,
            tbl_benutzerrolle.studiensemester_kurzbz,
            tbl_benutzerrolle.start,
            tbl_benutzerrolle.ende,
            tbl_benutzerrolle.negativ,
            tbl_benutzerrolle.updateamum,
            tbl_benutzerrolle.updatevon,
            tbl_benutzerrolle.insertamum,
            tbl_benutzerrolle.insertvon,
            tbl_benutzerrolle.kostenstelle_id,
            tbl_benutzerrolle.anmerkung
           FROM system.tbl_benutzerrolle,
            campus.vw_mitarbeiter
          WHERE (((tbl_benutzerrolle.funktion_kurzbz)::text = 'Mitarbeiter'::text) AND vw_mitarbeiter.aktiv)
        UNION
         SELECT tbl_benutzerrolle.benutzerberechtigung_id,
            vw_student.uid,
            tbl_benutzerrolle.funktion_kurzbz,
            tbl_benutzerrolle.rolle_kurzbz,
            tbl_benutzerrolle.berechtigung_kurzbz,
            tbl_benutzerrolle.art,
            tbl_benutzerrolle.art AS art1,
            tbl_benutzerrolle.oe_kurzbz,
            tbl_benutzerrolle.studiensemester_kurzbz,
            tbl_benutzerrolle.start,
            tbl_benutzerrolle.ende,
            tbl_benutzerrolle.negativ,
            tbl_benutzerrolle.updateamum,
            tbl_benutzerrolle.updatevon,
            tbl_benutzerrolle.insertamum,
            tbl_benutzerrolle.insertvon,
            tbl_benutzerrolle.kostenstelle_id,
            tbl_benutzerrolle.anmerkung
           FROM system.tbl_benutzerrolle,
            campus.vw_student
          WHERE (((tbl_benutzerrolle.funktion_kurzbz)::text = 'Student'::text) AND vw_student.aktiv)) a
     JOIN public.tbl_benutzer USING (uid))
  WHERE ((tbl_benutzer.aktiv = true) AND ((a.start <= now()) OR (a.start IS NULL)) AND ((a.ende >= now()) OR (a.ende IS NULL)) AND (NOT a.negativ) AND (NOT (EXISTS ( SELECT 1
           FROM (system.tbl_benutzerrolle
             JOIN system.tbl_berechtigung USING (berechtigung_kurzbz))
          WHERE (((tbl_benutzerrolle.uid)::text = (a.uid)::text) AND ((tbl_benutzerrolle.berechtigung_kurzbz)::text = (a.berechtigung_kurzbz)::text) AND tbl_benutzerrolle.negativ)))));


ALTER TABLE system.vw_berechtigung_nichtrekursiv OWNER TO fhcomplete;

--
-- Name: vw_berechtigung; Type: VIEW; Schema: system; Owner: fhcomplete
--

CREATE VIEW system.vw_berechtigung AS
 WITH RECURSIVE oes(oe_kurzbz, pfad) AS (
         SELECT tbl_organisationseinheit.oe_kurzbz,
            ('/'::text || (tbl_organisationseinheit.oe_kurzbz)::text) AS pfad
           FROM public.tbl_organisationseinheit
          WHERE ((tbl_organisationseinheit.oe_parent_kurzbz IS NULL) AND (tbl_organisationseinheit.aktiv = true))
        UNION ALL
         SELECT o.oe_kurzbz,
            ((COALESCE(oes.pfad, ''::text) || '/'::text) || (COALESCE(o.oe_kurzbz, ''::character varying))::text) AS pfad
           FROM public.tbl_organisationseinheit o,
            oes
          WHERE (((o.oe_parent_kurzbz)::text = (oes.oe_kurzbz)::text) AND (o.aktiv = true))
        )
 SELECT vw_berechtigung_nichtrekursiv.uid,
    vw_berechtigung_nichtrekursiv.berechtigung_kurzbz,
    vw_berechtigung_nichtrekursiv.art,
    oes.oe_kurzbz,
    vw_berechtigung_nichtrekursiv.kostenstelle_id
   FROM system.vw_berechtigung_nichtrekursiv,
    oes
  WHERE (((oes.pfad || '/'::text) ~~ (('%/'::text || (vw_berechtigung_nichtrekursiv.oe_kurzbz)::text) || '/%'::text)) OR ((vw_berechtigung_nichtrekursiv.oe_kurzbz IS NULL) AND (vw_berechtigung_nichtrekursiv.kostenstelle_id IS NULL)))
UNION
 SELECT vw_berechtigung_nichtrekursiv.uid,
    vw_berechtigung_nichtrekursiv.berechtigung_kurzbz,
    vw_berechtigung_nichtrekursiv.art,
    NULL::character varying(32) AS oe_kurzbz,
    vw_berechtigung_nichtrekursiv.kostenstelle_id
   FROM system.vw_berechtigung_nichtrekursiv
  WHERE (vw_berechtigung_nichtrekursiv.kostenstelle_id IS NOT NULL);


