27	German	26	1	t	<news><verfasser><![CDATA[Rektorat]]></verfasser><betreff><![CDATA[Wahl der VertreterInnen des Lehr- und Forschungspersonals im FH-Kollegium]]></betreff><text><![CDATA[Sehr geehrte LektorInnen,<br />sehr geehrte F&amp;E MitarbeiterInnen,<br /><br />es ist wieder einmal so weit, die VertreterInnen des Lehr- und Forschungspersonal im Fachhochschul-Kollegium m&uuml;ssen gew&auml;hlt werden. Die Aufgaben des FH-Kollegiums finden Sie am CIS unter Fachhochschulkollegium - Kollegiumswahl 2012.\n<p>Das FH-Kollegium besteht aus 4 VertreterInnen der Studierenden, 6 VertreterInnen des Lehr- und Forschungspersonals, 6 StudiengangsleiterInnen, dem Rektor und dem Vizerektor.</p>\n<p>Engagierte VertreterInnen aus dem Kreise unserer Lehrenden und F&amp;E MitarbeiterInnen sind im Kollegium sehr wichtig. Daher ersuche ich Sie als VertreterInnen unserer Lehrenden f&uuml;r das FH-Kollegium zu kandidieren.</p>\n<p>Bitte geben Sie Ihre <strong>Kandidatur bis 25.05.2012</strong> formlos schriftlich oder per E-Mail bei Frau Nicole Sagmeister (5. Stock, Zimmer 5.31, nicole.sagmeister@technikum-wien.at) bekannt. Die (Brief-)Wahl wird vom 01.06. &ndash; 15.06.2012 stattfinden.</p>\n<p>Das W&auml;hlerverzeichnis ist am CIS unter Fachhochschulkollegium - Kollegiumswahl 2012 ebenfalls einsehbar.</p>\n<p>Im Namen der Wahlkommission</p>\n<p>Rektor FH-Prof. Dipl.-Ing. Dr. Fritz Schm&ouml;llebeck</p>]]></text></news>	\N	\N	2012-05-22 15:58:06	admin	2012-05-22 15:57:38	admin	Wahl der VertreterInnen des Lehr- und Forschungspersonals im FH-Kollegium	\N
