29	German	28	1	t	<content>\n<titel><![CDATA[LAN]]></titel>\n<inhalt><![CDATA[<table class="tabcontent">\n<tbody>\n<tr>\n<td>Dieses Dokument soll dazu dienen Antworten auf h&auml;ufig gestellte Fragen &uuml;ber das FH-LAN zu beantworten. Sollten Sie hier keine Antworten finden, melden Sie sich bitte bei <a class="Item" href="mailto:support@technikum-wien.at">support@technikum-wien.at</a>.</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td><a class="Item2" href="#passwort"><img src="../skin/images/menu_item.gif" alt="" width="7" height="9" />&nbsp;Wie &auml;ndere ich mein Passwort?</a><br /> <a class="Item2" href="#mailserver"><img src="../skin/images/menu_item.gif" alt="" width="7" height="9" />&nbsp;Wie hei&szlig;en die Mail- und Newsgroupserver?</a><br /> <a class="Item2" href="#newsgroup"><img src="../skin/images/menu_item.gif" alt="" width="7" height="9" />&nbsp;Mit welchem Programmen kann ich auf die Newsgroups zugreifen?</a><br /> <a class="Item2" href="#fileserver"><img src="../skin/images/menu_item.gif" alt="" width="7" height="9" />&nbsp;Wie hei&szlig;t mein File-Server?</a><br /> <a class="Item2" href="#soft"><img src="../skin/images/menu_item.gif" alt="" width="7" height="9" />&nbsp;Wie installiere ich den SoftGrid Client?</a><br /> <a class="Item2" href="#mlaufwerk"><img src="../skin/images/menu_item.gif" alt="" width="7" height="9" />&nbsp;Wie kann ich mein M:\\ Laufwerk manuell verbinden (z.B. Laptop)?</a><br /> <a class="Item2" href="#desktop"><img src="../skin/images/menu_item.gif" alt="" width="7" height="9" />&nbsp;Warum werden meine Einstellungen am Windows NT/XP Desktop nicht gespeichert?</a><br /> <a class="Item2" href="#home"><img src="../skin/images/menu_item.gif" alt="" width="7" height="9" />&nbsp;Wie verbinde ich mich von zuhause mit meinem Home-Verzeichnis am FH Technikum Wien?</a><br /> <a class="Item2" href="#lehre"><img src="../skin/images/menu_item.gif" alt="" width="7" height="9" />&nbsp;Wie verbinde ich mich von zuhause mit dem Lehre-Verzeichnis am FH Technikum Wien?</a><br /> <a class="Item2" href="#weiterleiten"><img src="../skin/images/menu_item.gif" alt="" width="7" height="9" />&nbsp;Wie kann ich meine E-Mails an eine andere E-Mailadresse automatisch weiterleiten lassen?</a><br /> <a class="Item2" href="#absolventen"><img src="../skin/images/menu_item.gif" alt="" width="7" height="9" />&nbsp;Wie lange bleiben die Accounts der Absolventen erhalten?</a><br /> <a class="Item2" href="#proxy"><img src="../skin/images/menu_item.gif" alt="" width="7" height="9" />&nbsp;Wie funktioniert die Proxy-Konfiguration?</a><br /> <a class="Item2" href="#ldap"><img src="../skin/images/menu_item.gif" alt="" width="7" height="9" />&nbsp;Wie lauten die LDAP Adressbuch Einstellungen?</a><br /> <a class="Item2" href="#wlan"><img src="../skin/images/menu_item.gif" alt="" width="7" height="9" />&nbsp;Wie kann ich das WLAN an der FH verwenden?</a></td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td class="ContentHeader2">\n<table class="tabcontent">\n<tbody>\n<tr>\n<td><a name="passwort"></a>&nbsp;Wie &auml;ndere ich mein Passwort?</td>\n<td align="right" width="20"><a class="Item2" href="content.php?content_id=135">top&nbsp;</a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<table class="tabcontent">\n<tbody>\n<tr>\n<td class="tdwidth10">&nbsp;</td>\n<td>\n<p><strong>Windows NT/2000/XP:</strong></p>\n<p>Dr&uuml;cken Sie CTRL+ALT+DEL (STRG+ALT+ENTF). Es erscheint ein Fenster mit 6 verschiedenen Auswahlm&ouml;glichkeiten. Klicken Sie auf "Kennwort &auml;ndern ..." und folgen Sie den Anweisungen. <strong><span style="color: red;">Achtung:</span></strong> Es wird hier auch das Passwort f&uuml;r Unix, Mail und sonstige Dienste ge&auml;ndert.</p>\n<p><strong>Linux:</strong></p>\n<p>Geben Sie in der Konsole den Befehl passwd ein. Sie werden nach dem alten und zweimal nach dem neuen Passwort gefragt.</p>\n<p><strong>WebMail Plattform:</strong></p>\n<p>Unter dem Punkt "Mein Konto" den Punkt "Passwort" ausw&auml;hlen. Geben Sie Ihr altes Passwort und zweimal Ihr neues Passwort ein, best&auml;tigen Sie die Aktion mit "Passwort &auml;ndern"</p>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td class="ContentHeader2">\n<table class="tabcontent">\n<tbody>\n<tr>\n<td><a name="mailserver"></a>&nbsp;Wie hei&szlig;en die Mail- und Newsgroupserver?</td>\n<td width="20"><a class="Item2" href="content.php?content_id=135">top&nbsp;</a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<table class="tabcontent">\n<tbody>\n<tr>\n<td class="tdwidth10">&nbsp;</td>\n<td>\n<p>Zum Abholen von Mails: <strong>pop.technikum-wien.at<br /> </strong>Zum Versenden: <strong>smtp.technikum-wien.at</strong><br /> Newsgroups: <strong>news.technikum-wien.at</strong> Port: 119</p>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td class="ContentHeader2">\n<table class="tabcontent">\n<tbody>\n<tr>\n<td><a name="newsgroup"></a>&nbsp;Mit welchen Programmen kann ich auf die Newsgroups zugreifen?</td>\n<td width="20"><a class="Item2" href="content.php?content_id=135">top&nbsp;</a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<table class="tabcontent">\n<tbody>\n<tr>\n<td class="tdwidth10">&nbsp;</td>\n<td>Wir empfehlen f&uuml;r Email und Newsgroups die Verwendung von 'Mozilla Thunderbird'. Das Programm ist Open Source Software und kann hier heruntergeladen werden: http://www.mozilla.org. <br /> MS Outlook kann grunds&auml;tzlich KEINE Newsgroups lesen. Unter Windows XP steht 'Outlook Express', unter Windows Vista 'Windows Mail' zur Verf&uuml;gung und wird standardm&auml;&szlig;ig als Newsgroup-Reader verwendet. Unter Windows 7 ist standardm&auml;&szlig;ig KEIN solches Programm mehr installiert! Um Newsgroups ben&uuml;tzen zu k&ouml;nnen k&ouml;nnen Sie das Programm 'Windows Live Mail' installieren. (Link: http://download.live.com/wlmail)</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td class="ContentHeader2">\n<table class="tabcontent">\n<tbody>\n<tr>\n<td><a name="fileserver"></a>&nbsp;Wie hei&szlig;t mein File-Server?</td>\n<td width="20"><a class="Item2" href="content.php?content_id=135">top&nbsp;</a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<table class="tabcontent">\n<tbody>\n<tr>\n<td class="tdwidth10">&nbsp;</td>\n<td>\n<p>Lektoren-Accounts: <strong>fhe.technikum-wien.at</strong><br /> Accounts beginnend mit tw04: <strong>stud04.technikum-wien.at</strong><br /> Accounts beginnend mit tw05: <strong>stud05.technikum-wien.at</strong><br /> Accounts ab WS 2006 BA&amp;MA: <strong>stud06.technikum-wien.at</strong><br /> Accounts ab WS 2007 BA&amp;MA: <strong>stud07.technikum-wien.at</strong><br /> Accounts ab WS 2008 BA&amp;MA: <strong>stud08.technikum-wien.at</strong><br /> Accounts ab WS 2009 BA&amp;MA: <strong>stud09.technikum-wien.at</strong><br /> Accounts ab WS 2010 BA&amp;MA: <strong>stud10.technikum-wien.at</strong></p>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td class="ContentHeader2">\n<table class="tabcontent">\n<tbody>\n<tr>\n<td><a name="soft"></a>&nbsp;Wie installiere ich den SoftGrid Client?</td>\n<td width="20"><a class="Item2" href="content.php?content_id=135">top&nbsp;</a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<table class="tabcontent">\n<tbody>\n<tr>\n<td class="tdwidth10">&nbsp;</td>\n<td><a class="Item" href="content.php?content_id=113">SoftGrid Client Installationsanleitung</a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td class="ContentHeader2">\n<table class="tabcontent">\n<tbody>\n<tr>\n<td><a name="mlaufwerk"></a>&nbsp;Wie kann ich mein M:\\ Laufwerk manuell verbinden (z.B. Laptop)?</td>\n<td width="20"><a class="Item2" href="content.php?content_id=135">top&nbsp;</a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<table class="tabcontent">\n<tbody>\n<tr>\n<td class="tdwidth10">&nbsp;</td>\n<td>Klicken Sie mit der rechten Maustaste auf das Icon Netzwerkumgebung und w&auml;hlen Sie den Men&uuml;punkt Netzlaufwerk verbinden. Im Pfad geben Sie "<strong>\\\\[File-Server]\\[loginname]</strong>" ein, wobei <strong>[loginname]</strong> durch Ihren Login Namen zu ersetzen ist und <strong>[File-Server]</strong> Ihr zugeordneter Fileserver ist (<strong>fhe</strong>, <strong>stud02</strong>, <strong>stud03</strong>, ... siehe <a class="Item" href="#fileserver">hier</a>).<br /> Nach dr&uuml;cken des OK Buttons, erscheint nach kurzer Zeit ein neuer Dialog in dem Sie nach Ihrem Login Namen und dem Kennwort gefragt werden. Geben Sie die Daten noch einmal ein, und wenn alles richtig eingetragen wurde, steht Ihnen sofort ein Laufwerk <strong>M:\\</strong> zur Verf&uuml;gung.</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td class="ContentHeader2">\n<table class="tabcontent">\n<tbody>\n<tr>\n<td><a name="desktop"></a>&nbsp;Warum werden meine Einstellungen am Windows NT/XP Desktop nicht gespeichert?</td>\n<td width="20"><a class="Item2" href="content.php?content_id=135">top&nbsp;</a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<table class="tabcontent">\n<tbody>\n<tr>\n<td class="tdwidth10">&nbsp;</td>\n<td>Alle Studenten teilen sich dasselbe Profil. Deswegen k&ouml;nnen getroffene Einstellungen am Profil nicht gespeichert werden.</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td class="ContentHeader2">\n<table class="tabcontent">\n<tbody>\n<tr>\n<td><a name="home"></a>&nbsp;Wie verbinde ich mich von zuhause mit meinem Home-Verzeichnis am FH Technikum Wien?</td>\n<td width="20"><a class="Item2" href="content.php?content_id=135">top&nbsp;</a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<table class="tabcontent">\n<tbody>\n<tr>\n<td class="tdwidth10">&nbsp;</td>\n<td>Um sich von zu Hause aus zu verbinden ben&ouml;tigt man einen Internetzugang &uuml;ber einen Internetprovider, und ein SCP Programm (zB.: WinSCP) um die Daten kopieren zu k&ouml;nnen. Hostname ist Ihr Fileserver (siehe <a class="Item" href="#fileserver">hier</a>), die User ID und das Passwort entsprechen dem Loginnamen und dem Passwort im FH Bereich. <br /> Wenn die Verbindung erfolgreich hergestellt worden ist, findet man sich in seinem Homeverzeichnis wieder und man kann mit dem Dateitransfer beginnen. Eine alternative M&ouml;glichkeit ist die Verbindung mittels SSH (z.B. putty).</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td class="ContentHeader2">\n<table class="tabcontent">\n<tbody>\n<tr>\n<td><a name="lehre"></a>&nbsp;Wie verbinde ich mich von zuhause mit dem Lehre-Verzeichnis am FH Technikum Wien?</td>\n<td width="20"><a class="Item2" href="content.php?content_id=135">top&nbsp;</a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<table class="tabcontent">\n<tbody>\n<tr>\n<td class="tdwidth10">&nbsp;</td>\n<td>\n<p>So wie das pers&ouml;nliche Homeverzeichnis, liegt auch das Lehre Verzeichnis auf einem UNIX Server, auf den via SCP oder SSH aus dem Internet zugegriffen werden kann. Der Servername lautet "<strong>nestor.technikum-wien.at</strong>"</p>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td class="ContentHeader2">\n<table class="tabcontent">\n<tbody>\n<tr>\n<td><a name="weiterleiten"></a>&nbsp;Wie kann ich meine E-Mails an eine andere E-Mailadresse automatisch weiterleiten lassen?</td>\n<td width="20"><a class="Item2" href="content.php?content_id=135">top&nbsp;</a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<table class="tabcontent">\n<tbody>\n<tr>\n<td class="tdwidth10">&nbsp;</td>\n<td>Aktivieren Sie die Weiterleitung im Webmail: <a href="https://webmail.technikum-wien.at/" target="_blank">https://webmail.technikum-wien.at</a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td class="ContentHeader2">\n<table class="tabcontent">\n<tbody>\n<tr>\n<td><a name="absolventen"></a>&nbsp;Wie lange bleiben die Accounts der Absolventen erhalten?</td>\n<td width="20"><a class="Item2" href="content.php?content_id=135">top&nbsp;</a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<table class="tabcontent">\n<tbody>\n<tr>\n<td class="tdwidth10">&nbsp;</td>\n<td>1 Jahr nach Beendigen des Studiums werden die Accounts deaktiviert.</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td class="ContentHeader2">\n<table class="tabcontent">\n<tbody>\n<tr>\n<td><a name="proxy"></a>&nbsp;Wie funktioniert die Proxy-Konfiguration?</td>\n<td width="20"><a class="Item2" href="content.php?content_id=135">top&nbsp;</a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<table class="tabcontent">\n<tbody>\n<tr>\n<td class="tdwidth10">&nbsp;</td>\n<td>\n<p>Um den Proxy zu verwenden steht eine automatische Konfigurationshilfe zur Verf&uuml;gung!<br /> Daf&uuml;r sind folgende Einstellungen in der Netscape Konfiguration erforderlich:</p>\n<table class="tabcontent">\n<tbody>\n<tr>\n<td width="20">&nbsp;</td>\n<td>&bull; Men&uuml; Edit (Bearbeiten)<br /> &bull; Punkt Preferences (Einstellungen) w&auml;hlen<br /> &bull; In der Liste den Punkt Advanced (Erweiterte Einstellungen) aufklappen<br /> &bull; Den Punkt Proxies w&auml;hlen<br /> &bull; Auswahl Automatic Proxy Configuration ausw&auml;hlen<br /> &bull; URL: <a class="Item" href="http://cis.technikum-wien.at/config/fh.pac" target="_blank">http://cis.technikum-wien.at/config/fh.pac</a></td>\n</tr>\n</tbody>\n</table>\n<br /> Damit werden automatisch die richtigen Einstellungen f&uuml;r den neuen Proxy &uuml;bernommen.</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td class="ContentHeader2">\n<table class="tabcontent">\n<tbody>\n<tr>\n<td><a name="ldap"></a>&nbsp;Wie lauten die LDAP Adressbuch Einstellungen?</td>\n<td width="20"><a class="Item2" href="content.php?content_id=135">top&nbsp;</a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<table class="tabcontent">\n<tbody>\n<tr>\n<td class="tdwidth10">&nbsp;</td>\n<td>Die Einstellungen f&uuml;r den Zugriff auf das Technikum-Wien LDAP Adressbuch h&auml;ngen davon ab, ob man intern (TW LAN) oder extern auf das LDAP-Adressbuch zugreifen m&ouml;chte.<br /> <br /> <strong>interner Zugriff:</strong><br /> Um das Technikum-Wien LDAP Adressbuch intern nutzen zu k&ouml;nnen sind folgende Einstellungen notwendig:<br /> <br />\n<table>\n<tbody>\n<tr>\n<td>Server:</td>\n<td>ldap.technikum-wien.at</td>\n</tr>\n<tr>\n<td>Suchbereich:</td>\n<td>ou=people,dc=technikum-wien,dc=at</td>\n</tr>\n<tr>\n<td>Port:</td>\n<td>389</td>\n</tr>\n</tbody>\n</table>\n<br /> <strong>externer Zugriff:</strong><br /> Um von extern auf das Technikum-Wien LDAP Adressbuch zugreifen zu k&ouml;nnen ist eine Authentifizierung am LDAP-Server erforderlich. <br /> <br /> Anleitung f&uuml;r Konfiguration MailClient finden Sie <a class="Item" href="dms.php?id=439">hier</a>.<br /> <br /> In beiden F&auml;llen ist die Konfiguration via SSL (verschl&uuml;sselte Verbindung) Port: 636 m&ouml;glich</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td class="ContentHeader2">\n<table class="tabcontent">\n<tbody>\n<tr>\n<td><a name="wlan"></a>&nbsp;Wie kann ich das WLAN an der FH verwenden?</td>\n<td width="20"><a class="Item2" href="content.php?content_id=135">top&nbsp;</a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<table class="tabcontent">\n<tbody>\n<tr>\n<td class="tdwidth10">&nbsp;</td>\n<td><a class="Item" href="content.php?content_id=106">WLAN Registration an der FH</a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n</tbody>\n</table>]]></inhalt>\n</content>	\N	\N	2012-05-22 15:59:36	admin	2012-05-22 15:58:49	admin	LAN	\N
